import { useState } from "react";

import axios from 'axios';

function Login() {
let [username,setUSername]=useState("");
let [password,setPassword]=useState("");


    const [errorMsg, setErrorMsg] = useState("");
let navigate = useNavigate();
let handleSubmitButton=async (event)=> {
    event.preventDefault();
    let values = {"username":username,"password":password};
    try{
    let result = await axios.post("http://localhost:8081/user/signin",values);
    //console.log(result.data);
    if(result.data=="Admin Success"){
        navigate("/Admin");
    }else if(result.data=="Customer success"){
        navigate("/Customer");
    }else {
        alert(result.data);
    }
    }catch(ex){
        console.log(ex);
    }
}
return (
    <form>

      <div class="form-outline mb-4">
        <input type="email" id="form2Example1" class="form-control" onChange={e=>setUSername(e.target.value)}/>
        <label class="form-label" for="form2Example1">Email address</label>
      </div>


      <div class="form-outline mb-4">
        <input type="password" id="form2Example2" class="form-control" onChange={e=>setPassword(e.target.value)}/>
        <label class="form-label" for="form2Example2">Password</label>
      </div>



      <button type="button" class="btn btn-primary btn-block mb-4">Sign in</button>


      <div class="text-center">
        <p>Not a member? <a href="#!">Register</a></p>
        <p>or sign up with:</p>
        <button type="button" class="btn btn-link btn-floating mx-1">
          <i class="fab fa-facebook-f"></i>
        </button>

        <button type="button" class="btn btn-link btn-floating mx-1">
          <i class="fab fa-google"></i>
        </button>

        <button type="button" class="btn btn-link btn-floating mx-1">
          <i class="fab fa-twitter"></i>
        </button>

        <button type="button" class="btn btn-link btn-floating mx-1">
          <i class="fab fa-github"></i>
        </button>
      </div>
    </form>

      );

}

export default Login;
